return {
    EditHbl: function (btn, entity) {
        var featureName = "sea-export-fcl-editor";
        switch (entity.TypeId) {
            case 1:
                featureName = "air-export-editor";
                break;
            case 2:
                featureName = "sea-import-editor";
                break;
            case 3:
                featureName = "sea-export-fcl-editor";
                break;
            case 4:
                featureName = "sea-import-fcl-editor";
                break;
            case 5:
                featureName = "sea-export-lcl-editor";
                break;
            case 6:
                featureName = "sea-import-lcl-editor";
                break;
            case 16:
                featureName = "sea-import-consol-editor";
                break;
            case 17:
                featureName = "sea-export-consol-editor";
                break;
            default:
                break;
        }
        this.OpenPopup(featureName, { Id: entity.ParentId }, true, { HblEntity: entity });
    }
}

