return {
  tooltip: {
    trigger: 'axis',
    axisPointer: {
      type: 'cross',
      crossStyle: { color: '#999' }
    }
  },
  toolbox: {
    feature: {
      dataView: { show: true, readOnly: false },
      magicType: { show: true, type: ['line', 'bar'] },
      restore: { show: true },
      saveAsImage: { show: true }
    }
  },
  legend: {
    data: ['Revenue', 'Cost', 'Profit', 'Receivables', 'Paid', 'Remaining']
  },
  grid: {
    left: '5%',
    right: '5%',
    bottom: '10%',
    containLabel: true
  },
  xAxis: [
    {
      type: 'category',
      data: this.Data[0]
        .map(x => ({
          ...x,
          total: x.ActualRevenueUSD + x.ActualCostUSD + x.ActualProfitUSD
        }))
        .sort((a, b) => a.total - b.total)
        .map(x => x.label),
      axisPointer: { type: 'shadow' },
      boundaryGap: true
    }
  ],
  yAxis: [
    {
      type: 'value',
      name: 'Amount',
      min: function (value) {
        return value.min < 0 ? value.min * 1.2 : 0;
      },
      axisLabel: {
        formatter: function (value) {
          return new Intl.NumberFormat('de-DE', {
            maximumFractionDigits: 0
          }).format(value) + ' $';
        }
      }
    },
    {
      type: 'value',
      name: 'Balance',
      position: 'right',
      axisLabel: {
        formatter: function (value) {
          return new Intl.NumberFormat('de-DE', {
            maximumFractionDigits: 0
          }).format(value) + ' $';
        }
      }
    }
  ],
  series: (() => {
    let sortedData = this.Data[0]
      .map(x => ({
        ...x,
        total: x.ActualRevenueUSD + x.ActualCostUSD + x.ActualProfitUSD
      }))
      .sort((a, b) => a.total - b.total);

    return [
      {
        name: 'Revenue',
        type: 'bar',
        stack: 'Total',
        barWidth: 20,
        barGap: '-100%',
        barMinHeight: 5,
        tooltip: {
          valueFormatter: function (value) {
            return new Intl.NumberFormat('de-DE', {
              maximumFractionDigits: 0
            }).format(value) + ' $';
          }
        },
        data: sortedData.map(x => x.ActualRevenueUSD)
      },
      {
        name: 'Cost',
        type: 'bar',
        stack: 'Total',
        barWidth: 20,
        barGap: '-100%',
        barMinHeight: 5,
        tooltip: {
          valueFormatter: function (value) {
            return new Intl.NumberFormat('de-DE', {
              maximumFractionDigits: 0
            }).format(value) + ' $';
          }
        },
        data: sortedData.map(x => x.ActualCostUSD)
      },
      {
        name: 'Profit',
        type: 'bar',
        stack: 'Total',
        barWidth: 20,
        barGap: '-100%',
        barMinHeight: 5,
        tooltip: {
          valueFormatter: function (value) {
            return new Intl.NumberFormat('de-DE', {
              maximumFractionDigits: 0
            }).format(value) + ' $';
          }
        },
        data: sortedData.map(x => x.ActualProfitUSD)
      },
      {
        name: 'Receivables',
        type: 'line',
        smooth: true,
        yAxisIndex: 1, // Dùng trục y bên phải
        tooltip: {
          valueFormatter: function (value) {
            return new Intl.NumberFormat('de-DE', {
              maximumFractionDigits: 0
            }).format(value) + ' $';
          }
        },
        data: sortedData.map(x => x.REUSD)
      },
      {
        name: 'Paid',
        type: 'line',
        smooth: true,
        yAxisIndex: 1, // Dùng trục y bên phải
        tooltip: {
          valueFormatter: function (value) {
            return new Intl.NumberFormat('de-DE', {
              maximumFractionDigits: 0
            }).format(value) + ' $';
          }
        },
        data: sortedData.map(x => x.PEUSD)
      },
      {
        name: 'Remaining',
        type: 'line',
        smooth: true,
        yAxisIndex: 1, // Dùng trục y bên phải
        tooltip: {
          valueFormatter: function (value) {
            return new Intl.NumberFormat('de-DE', {
              maximumFractionDigits: 0
            }).format(value) + ' $';
          }
        },
        data: sortedData.map(x => x.REMAINUSD)
      }
    ];
  })()
};

