            },
            axisTick: {
                distance: -25,
                length: 8,
                lineStyle: {
                    color: '#fff',
                    width: 2
                }
            },
            splitLine: {
                distance: -25,
                length: 25,
                lineStyle: {
                    color: '#fff',
                    width: 4
                }
            },
            axisLabel: {
                color: '#333',
                distance: 40,
                fontSize: 9,
                fontFamily: 'Arial, sans-serif'
            },
            detail: {
                valueAnimation: true,
                formatter: '{value}%',
                color: '#333',
                fontSize: 22,
                fontWeight: 'bold',
